import {makeStyles} from '@material-ui/core/styles'

export default makeStyles(()=>({
    imageWrapper:{
        position: 'relative',
    },
    imgOverlay:{
        position: 'absolute',
        top: '0',
        bottom: '0',
        left: '0',
        right: '0',
        textAlign: 'center'
    },
    imgOverlay:{
        content: ' ',
        display: 'block',
        height: '45%'
    }

}));
